import Home from './component/home';
import Login from './component/auth/login';
import './App.css';
import {
  BrowserRouter,
  Switch,
  Route,
} from "react-router-dom";
function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header className="App-header">
          Header
        </header>
        <Switch>
          <Route path="/" exact>
            <Home />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
